import React, { useContext } from 'react'
import { Link } from 'react-router-dom'
import AuthContext from '../context/AuthContext'

const Header = () => {
  let {user, logoutUser} = useContext(AuthContext)

  const loginAndRegisterComp = <div><Link to='/login'>Login</Link><span>|</span><Link to='/register'>Register</Link></div>

  

  return (
    <div>
      {user && <span>Hello userId: {user.user_id} ! </span>}
      <span> | </span>
      <Link to='/'>Home</Link>
      <span> | </span>
      {user ? <span onClick={logoutUser}>Logout</span> : loginAndRegisterComp}
    </div>
  )
}

export default Header
